model: cog_predict.py:Model
environment:
  python_packages:
    - scipy==1.5.4
    - scikit-image==0.17.2
    - ipdb==0.13.4
    - pandas==1.1.5
    - lmdb==1.0.0
    - opencv-python==4.5.1.48
    - easing-functions==1.0.4
    - torch==1.7.0
